  try {
    const responseRestaurant = await axios.get(
      "http://localhost:8080/restaurants"
    );
    dataResRestaurants= responseRestaurant.data.result;
    console.log(dataResRestaurants);
  } catch (err) {
    console.log(err);
  }
};



const AddRestaurantData = () => {

  useEffect(() => {
  fetchRestaurantsData();
}, []);

  return dataResRestaurants.values;

};
export default AddRestaurantData;
